import React from 'react';
import '../styles/home.css';
import Logo from '../images/sample-logo.jpeg';

function Home() {
  return (
    <div>
      <img src={ Logo } alt="Guilherme Castelo Branco Logo" />
      <h1>Home</h1>
    </div>
  );
}

export default Home;
